import { NavLink, Route, Switch, Redirect} from 'react-router-dom';
import React from 'react';
import classes from './NavBar.css'
import { useState } from 'react';

function NavBar() {

    const [path, setPath] = useState('/')

    function onTabClick(event) {
        console.log(event.target.id)
        setPath('/' + event.target.id)
    }
    
    return ( 
        <div className={classes.container}>

        <NavLink activeClassName={classes.active} to={path}>
        <button id='home' onClick={onTabClick}> <img id='home' src='favicon.ico'/> </button>
        </NavLink>

        <NavLink activeClassName={classes.active} to={path}>
        <button id='1' onClick={onTabClick}>Tab 1</button>
        </NavLink>
        
        <NavLink activeClassName={classes.active} to={path}>
        <button id='2' onClick={onTabClick}>Tab 2</button>
        </NavLink>
        
        <NavLink activeClassName={classes.active} to={path}>
        <button id='3' onClick={onTabClick}>Tab 3</button>
        </NavLink>
        
        
        </div>
     );
}

export default NavBar;
